//import './EntitysList.css';

import ListGroup from 'react-bootstrap/ListGroup';

function EntitysList() {
  return (
    <div className="entitysList">
      <ListGroup>
        <ListGroup.Item active={true}>Transactions</ListGroup.Item>
        <ListGroup.Item>Customers</ListGroup.Item>
      </ListGroup>
    </div>
  );
}

export default EntitysList;
